        ) as X ON X.theme_id = theme_fields.theme_id WHERE "theme_fields"."theme_id" = 2 AND "theme_fields"."target_id" IN (0, 0) AND "theme_fields"."name" = 'scss' ORDER BY theme_sort_column, "theme_fields"."target_id" ASC

